(function($) {
    $.fn.spin = function(opts, color) {
        var presets = {
            "tiny": { lines: 8, length: 2, width: 2, radius: 3 },
            "small": { lines: 8, length: 4, width: 3, radius: 5 },
            "medium": { lines: 10, length: 8, width: 4, radius: 8 },
            "large": { lines: 13, length: 18, width: 9, radius: 26 },
            "xlarge": { lines: 13, length: 23, width: 13, radius: 32 }
        };
        if (Spinner) {
            return this.each(function() {
                var $this = $(this),
                    data = $this.data();

                if (data.spinner) {
                    data.spinner.stop();
                    delete data.spinner;
                }
                if (opts !== false) {
                    if (typeof opts === "string") {
                        if (opts in presets) {
                            opts = presets[opts];
                        } else {
                            opts = {};
                        }
                        if (color) {
                            opts.color = color;
                        }
                    }
                    data.spinner = new Spinner($.extend({color: $this.css('color')}, opts)).spin(this);
                }
            });
        } else {
            throw "Spinner class not available.";
        }
    };
})(jQuery);

$(document).ready(function() {

    $('.disabled').live('click', function () {
        return false;
    });

    jQuery.timeago.settings.allowFuture = true;
    $(".timeago").timeago();

    $('textarea').elastic();

    $(".datepicker").datepicker({
        changeMonth: true,
        changeYear: true,
        dateFormat: 'dd/mm/yy',
        minDate: '01/01/1918',
        maxDate: '-10y',
        yearRange: '1918:2118'
    });

    $('#project_status').popover();

    $('.social_edit.active').live('click', function () {
        return false;
    });
    $('.social_edit:not(.active)').live('click', function () {
        $('.social_edit_icons a').removeClass('active');
        var service = $(this);
        var $form = $('.social_edit_form');
        $form.spin();
        $form.find('.alert').hide();
        service.addClass('active');
        $form.find('input[id="servicename"]').val(service.data('social-name'));
        var url = $form.attr( 'action' ) + '?findsocialservice=' + $form.find('input[id="servicename"]').val();
        $.get(url, function(data) {
            $form.find('input[id="socialservice"]').val($.trim(data));
            $form.find('h3').text(service.data('social-name'));
            $form.find('.add-on').text(service.data('social-prepend'));
            $form.spin(false);
        });
        return false;
    });

    $(".social_edit_form").submit(function(event) {
        event.preventDefault();
        var $form = $( this ),
        service = $form.find( 'input[id="servicename"]' ).val(),
        term = $form.find( 'input[id="socialservice"]' ).val(),
        url = $form.attr( 'action' );
        $form.spin();
        $.post(
            url, {
                service: service,
                value: term
            },
            function( data ) {
                $form.find('.alert .alert_text').text(data).show();
                $form.find('.alert').show();
            }
        );
        $form.spin(false);
    });

    $('.inbox-table tr').click(function() {
        var href = $(this).data("url");
        if(href) {
            window.location = href;
        }
    });

    $('.opt').live('click', function () {
        $('.profile_content_main').spin();
        $.ajax({
            url: $(this).attr('href'),
            success: function(data) {
                $('.profile_content_main').html(data);
            }
        });
        return false;
    });

    $('.launch_btn').live('click', function () {
        $(this).addClass('disabled');
        var modalwindow = $(this).closest('.modal');
        modalwindow.spin("xlarge");
    });

    /*
     * Form Stuffs
     */
    $('input#bounty').autoNumeric({aSign: '£'});

    /**
     * Load the error classes correctly for all errored forms
     */
    $('.control-group').each(function() {
        if ($(this).find('ul.errors').length) {
            $(this).addClass('error');
        }
    });

    /**
     * Authorise a bounty
     */
    $('#authorise-project').live('click', function() {
        $(this).parents('form').submit();
        return false;
    });

    /**
     * Popovers
     */
    $('#cal .calendar_tip a').each(function() {
        $(this).popover({
            html: true,
            trigger: 'hover',
            delay: { hide: 1000 }
        });
    });

    /**
     * New project NDA display
     */
    $('#nda_upload').live('change', function() {
        if ($(this).val() == '1') {
            $('#project_nda').parents('.control-group').css('display', 'block');
            $('#audience_age').val('rs');
            $('#audience_age option[value!=rs]').attr('disabled', 'disabled');
        } else {
            $('#project_nda').parents('.control-group').css('display', 'none');
            $('#audience_age option').removeAttr('disabled');
            $('#audience_age').val('');
        }
    });
    if ($('#nda_upload').length) {
        $('#nda_upload').change();
    }

    /**
     * Bounty winner amounts
     */
    $('.winner_amount').on('click', '.btn', function() {
        if ($(this).hasClass('up') && parseFloat($('.winner_amount input').val()) < 10) {
            $('.winner_amount input').val(parseFloat($('.winner_amount input').val()) + 1);
        }
        if ($(this).hasClass('down') && parseFloat($('.winner_amount input').val()) > 1) {
            $('.winner_amount input').val(parseFloat($('.winner_amount input').val()) - 1);
        }

        // Work out the winners amount
        var amount = $('.winner_amount').data('amount') / parseFloat($('.winner_amount input').val());
        $('.winner_amount .num span').text(number_format(amount));
        if ($('.winner_amount input').val() == '1') {
            $('.winner_amount strong').text('winner');
            $('.winner_amount .each').hide();
        } else {
            $('.winner_amount strong').text('winners');
            $('.winner_amount .each').show();
        }

        return false;
    });

    /**
     * Select winners
     */
    $('.select-winners').live('click', function() {
        if ($('[name="winners[]"]:checked').length == 0) {
            alert('Please select one or more winners before confirming!');
            $('#winning_dialog').modal('hide');
        } else {
            // Submit the prototypes
            var winners = [];
            $('[name="winners[]"]:checked').each(function() {
                winners.push($(this).val());
            });
            window.location = $(this).attr('href') + '?winners=' + winners.join(',');
        }

        return false;
    });

    /**
     * Load WYSIWYG editor
     */
    $('.wysiwyg').each(function() {
        CKEDITOR.replace($(this).attr('id'));
    });

    /**
     * Show the moderation add form when necessary
     */
    $('.add-moderators').on('click',function() {
        if ($('#add-moderators').hasClass('open')) {
            $('#add-moderators').removeClass('open').slideUp(200);
        } else {
            $('#add-moderators').addClass('open').slideDown(200);
        }
        return false;
    });

    /**
     * Set up the autocomplete
     */
    $('#add-moderators input[type=text]').tagsInput({
        autocomplete_url: '/?autocomplete=1',
        default_text: 'add a user'
    });
});